import React from "react";

class App extends React.Component {

  state = {
    count: 0
  }
  incrementCount = () => {
    this.setState({ count: this.state.count + 1 })
  }
  decrementCount = () => {
    this.setState({ count: this.state.count - 1 })
  }
  render() {
    return (
      <p><button onClick={this.incrementCount}>+</button>{this.state.count}<button onClick={this.decrement}>-</button></p>
    )
  }
}
export default App;
